@HalfHearted_JG @HistoryMuppet 2016 was a Movie Festival &amp; someone at the main ticket counter became sick so i was asked to work instead
During the first hour the ticket id sys blackout &amp; i sold about 2000 Tickets with a handwritten list
Afterwards Meryl Streep came to my desk &amp; thanked me for saving the night
